      };

    return (
    <div style={searchContainer}>
        <form onSubmit={handleSubmit}>
         <TextField id="search" label="Search for track or artist" value={searchQuery} onChange={handleInputChange} />
         <Button variant="contained" color="primary" type="submit">
  Search
</Button>
</form>
    </div>
    )
}

